import './App.css';
import {Component} from 'react'; 
import data from "./got.json"; 
import {CardList} from './components/card-list/card-list.component'; 

class App extends Component {

  constructor() {
    super(); 
    this.state = {
      characters :[
      ]
    }
  }

  //runs after the component output has been rendered to the DOM
  componentDidMount() { 
    this.setState({characters: data});     
  }

  // method examines this.props, which are parameters passed down by the parent and this.state, which is internal to the component
  render() {
    return (
      <div className="App">
      <CardList name="Cariny">
        {this.state.characters.map(character => <h1 key={character.id}> {character.name}</h1>)}
      </CardList>
    </div>
  );
  }
}
export default App;
